import "./ProductCard.css"

export function ProductCard(props) {

    const {title} = {props}

    return (
        <div className="product-card">
            <img src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTyc4jSYiHdzSAd9sZK6NSOlIgUL1bLuphQHQ&s" className="product-card__img" alt="изображение" />
            <h3 className="product-card__title">{title}</h3>
            <span className="product-card__like-counter">Лайки: </span>
            <button className="product-card__like-btn product-card__btn">Лайкнуть!</button>
        </div>
    )
}
